Correspondence and papers include:

Correspondence of Emily Penrose, Somerville College, Oxford about the entrance of Janet Adam Smith into University in October 1923, 1921-1923;

Copies of Somerville College English Literature Scholarship and Entrance Examination papers, 1923;

Lecture List and Summer Reading list, 1925;

Examination papers of Oxford University Honour School of English Language and Literature, for 1926;

Janet Adam Smith Testimonials, 1926;

Correspondence and newspaper cuttings on her Oxford University results and just missing out on a First Class Degree, July-August 1926.
